var diy=[];

function showBoroad(){
    document.getElementById('options').style.transform='translate(0,-500%)';
}
function  hideBoroad() {
    document.getElementById('options').style.transform='translate(0,0)';
}

document.getElementById('refresh').addEventListener('click',function(e){
    diy=[];
    document.getElementById('mainsvg').innerHTML=diy.join('');
})

document.getElementById('share').addEventListener('click',function (e) {
    alert('点右上角分享哦～');
})

document.getElementById('theme').addEventListener('click',function (e) {

    showBoroad();
    for(var i in document.images){
        document.images[i].addEventListener("click",function (e) {
            document.getElementById('mainsvg').innerHTML=themes[e.target.dataset.index];

        })
    }

})

document.getElementById('outter').addEventListener('click',function (e) {
    if(diy.length==0)  document.getElementById('mainsvg').innerHTML='';
    document.getElementById('imgcontainer').innerHTML='';
    document.getElementById('imgcontainer').innerHTML=content;
    showBoroad();
    for(var i in document.images){
        document.images[i].addEventListener("click",function (e) {
            diy[0]=outters[e.target.dataset.index]
            document.getElementById('mainsvg').innerHTML=diy.join('');

        })
    }
})

document.getElementById('buttons').addEventListener('click',function (e) {
    if(diy.length==0)  document.getElementById('mainsvg').innerHTML='';
    document.getElementById('imgcontainer').innerHTML='';
    document.getElementById('imgcontainer').innerHTML=content;
    showBoroad();
    for(var i in document.images){
        document.images[i].addEventListener("click",function (e) {
            diy[1]=buttons[e.target.dataset.index]
            document.getElementById('mainsvg').innerHTML=diy.join('');

        })
    }
})

document.getElementById('others').addEventListener('click',function (e) {
    document.getElementById('mainsvg').innerHTML='';
    document.getElementById('imgcontainer').innerHTML='';
    showBoroad();
    for(var i in document.images){
        document.images[i].addEventListener("click",function (e) {
            document.getElementById('othersSvg').innerHTML=themes[e.target.dataset.index];

        })
    }
})



